{color}{color:#000000}Long press on the volume button to manually reset the IDC {color}{color:#000000}

*{color}{color:#000000}expected result/behaviour{color}{color:#000000}**{color}{color:#000000}:{color}{color:#000000}*

{color}{color:#000000}IDC is performing a reset and the reset reason is visible in the DTCs. {color}{color:#000000}

*{color}{color:#000000}observed result/behaviour{color}{color:#000000}**{color}{color:#000000}:{color}{color:#000000}*

+{color}{color:#000000}14.03.2024, 09:33:22{color}{color:#000000}+

{color}{color:#000000}After long pressing the volume button, the IDC is performing an IDC Reset, as it was induced by the driver. As a result, there is a massive amount of DTCs: {color}{color:#000000}

{color}{color:#000000} !|width=830,height=693036!{color}{color:#000000} {color}{color:#000000}!|width=866,height=158886!{color}{color:#000000}

{color}{color:#000000} {color}{color:#000000}

{color}{color:#000000}+The problem is+: When looking at the DTCs, there is no chance to identify, that this reset was meant to be by the customer. You can either have a look at _statusPushButtonAudio_ 0xB504 on IuKEth or have a look at the DLTs. {color}{color:#000000}

{color}{color:#000000}20s push on volume button:{color}{color:#000000}

{color}{color:#000000}!|width=781,height=1136!{color}{color:#000000}

{color}{color:#000000} {color}{color:#000000}

{color}{color:#000000}BUT, the DLT from this timestamp states WAKEUP_REASON_SYSTEM_RESET â€“ although it was a customer reset.{color}{color:#000000}

{color}{color:#000000}!|width=779,height=205068!{color}{color:#000000}

{color}{color:#000000} {color}{color:#000000}

{color}{color:#000000}In comparison, please have a look at this ticket: {color}{color:#000000}[Defect 1705661 - DTC 0xD75C98 - ST_DISP_DRASY missing leads to CCM 2348/476 (SWW and AD)|https://octane-prod.bmwgroup.net/ui/entity-navigation?p=1002/2001&entityType=work_item&id=1705661]{color}{color:#000000}

{color}{color:#000000}The defect finder complains about a system reset of the IDC (which is also visible in the attached videos, the driver doesnâ€™t push the volume button and has both hands on the steering wheel; furthermore the IDC did not really reset, there were only FAS CCMs). {color}{color:#000000}

{color}{color:#000000}Anyhow, the ticket was closed with the â€œargumentâ€: customer reset, because the DLT showed WAKEUP_REASON_CUSTOMER_RESET{color}{color:#000000}

{color}{color:#000000}!|width=138,height=336!{color}{color:#000000}

{color}{color:#000000} {color}{color:#000000}

{color}{color:#000000}This brings me to the conclusion, that there must be something mixed up with the reset reason in the DLT logging.{color}{color:#000000}

{color}{color:#000000} {color}{color:#000000}

*{color}{color:#000000}possible impact{color}{color:#000000}**{color}{color:#000000}:{color}{color:#000000}*

{color}{color:#000000}Reset reason of IDC reset is interpreted in a wrong way, which leads to bad ticket analysis.{color}{color:#000000}

{color}{color:#000000} {color}{color:#000000}

*{color}{color:#000000}actions/steps to recover from error:{color}{color:#000000}*

{color}{color:#000000}fix DLT logging{color}{color:#000000}

