{color}{color:#000000} {color}{color:#000000}{color:#000000}

{color}{color:#000000}+The problem is+: When looking at the DTCs, there is no chance to identify, that this reset was meant to be by the customer. You can either have a look at _statusPushButtonAudio_ 0xB504 on IuKEth or have a look at the DLTs. {color}{color:#000000}{color:#000000}

