{color}{color:#000000} {color}{color:#000000}{color:#000000}

{color}{color:#000000}BUT, the DLT from this timestamp states WAKEUP_REASON_SYSTEM_RESET â€“ although it was a customer reset.{color}{color:#000000}{color:#000000}

{color}{color:#000000}!|width=779,height=205068!{color}{color:#000000}{color:#000000}

{color}{color:#000000} {color}{color:#000000}{color:#000000}

{color}{color:#000000}In comparison, please have a look at this ticket: {color}{color:#000000}\[Defect 1705661 - DTC 0xD75C98 - ST_DISP_DRASY missing leads to CCM 2348/476 (SWW and AD)|https://octane-prod.bmwgroup.net/ui/entity-navigation?p=1002/2001&entityType=work_item&id=1705661]{color}{color:#000000}{color:#000000}

{color}{color:#000000}The defect finder complains about a system reset of the IDC (which is also visible in the attached videos, the driver doesnâ€™t push the volume button and has both hands on the steering wheel; furthermore the IDC did not really reset, there were only FAS CCMs). {color}{color:#000000}{color:#000000}

{color}{color:#000000}Anyhow, the ticket was closed with the â€œargumentâ€: customer reset, because the DLT showed WAKEUP_REASON_CUSTOMER_RESET{color}{color:#000000}{color:#000000}

{color}{color:#000000}!|width=138,height=336!{color}{color:#000000}{color:#000000}

{color}{color:#000000} {color}{color:#000000}{color:#000000}

{color}{color:#000000}This brings me to the conclusion, that there must be something mixed up with the reset reason in the DLT logging.{color}{color:#000000}{color:#000000}

